优化 attr 配置方法, 可以使用 valuesMap 配置  优先级 callback > valuesMap

样例如下

```
shape={{
  type: 'linear',
  field: 'type',
  valuesMap: {
    'value == "companyB"': 'dash',
    'companyC': 'dash',
    DEFAULT: 'line'
  },
}}
```
```
color={{
  field: 'sales',
  valuesMap: {
    'value > 70': 'red',
    DEFAULT: 'blue',
  },
}}
```
